actionCellButton.customFunction:
let $injector = widgetContext.$scope.$injector;
let dialogs = $injector.get(widgetContext.servicesMap.get('dialogs'));
let deviceService = $injector.get(widgetContext.servicesMap.get('deviceService'));
let userAuthority = widgetContext.currentUser.authority;

openDeleteEntityDialog();

function openDeleteEntityDialog() {
    let title = 'Delete thermostat "' +  entityName + '"';
    let content = 'Are you sure you want to delete the thermostat "' + entityName + '"?';
    dialogs.confirm(title, content, 'Cancel', 'Delete').subscribe(
        function(result) {
            if (result) {
                deleteEntity();
            }
        }
    );
}

function deleteEntity() {
    if (userAuthority === 'CUSTOMER_USER') {
        deviceService.unclaimDevice(entityName, {ignoreErrors: true}).subscribe(
            function success() {
                widgetContext.showSuccessToast('Device \'' + entityName + '\' successfully deleted!');
                widgetContext.updateAliases();
            },
            function fail(error) {
                if (error.error && error.error.message) {
                    showDialog('Failed to delete device', error.error.message);
                } else {
                    widgetContext.showErrorToast('Failed to delete device');
                }
            }
        ); 
    } else {
        deviceService.deleteDevice(entityId.id, {ignoreErrors: true}).subscribe(
            function success() {
                widgetContext.showSuccessToast('Device \'' + entityName + '\' successfully deleted!');
                widgetContext.updateAliases();
            },
            function fail() {
                showErrorDialog();
            }
        );
    }
}

function showDialog(title, error) {
    setTimeout(function() {
        widgetContext.dialogs.alert(title, error).subscribe();
    }, 100);
}

function showErrorDialog() {
    let title = 'Error';
    let content = 'An error occurred while deleting the thermostat. Please try again.';
    dialogs.alert(title, content, 'CLOSE').subscribe(
        function(result) {}
    );
}

